import React from 'react';
import { StringLiteral } from 'typescript';
import './App.css';
import jsonObject from './JSON/test.json'

// Defining our Todo class 
class Todo { 
    userId!: number; 
    id!: number; 
    title!: string; 
    done!: boolean;
    label!: string;
    name1!: string;
    spec1!: string;

    getLabel() { 
        return this.label; 
    }

    getName() {
        return this.name1;
    }

    getSpec() {
        return this.spec1;
    }

    isDone() { 
        return this.done; 
    } 
} 

// Object.assign() will clone jsonData into 
// Todo class object Storing the new class 
// object in a typescript variable 
let newTodo = Object.assign(new Todo(), jsonObject); 


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Overview</h1>
          {createCard(newTodo.getLabel(), newTodo.getName())}
          <br/>
          {createCard("Sexual Orientation", "Sexual Orientation")}
      </header>
    </div>
  );
}

function createCard(label: string, name: string) {
  return (
    <section className="labelCard"> 
        <h1>{label}</h1>
        <div className="cards">
            <section className="CDECard">
                <h2>{name}</h2>
                12/27/19 @11:51AM: Howard changed the CDE name to General Health Score. <br />
                2/14/20 @7:13AM: Debby added to the discussion board. <br />
                3/5/20 @1:28PM: Janet proposed adding a new column. <br />
            </section>
            <section className="CDECard">
                <h2>{name}</h2>
                12/27/19 @11:51AM: Howard changed the CDE name to General Health Score. <br />
                2/14/20 @7:13AM: Debby added to the discussion board. <br />
                3/5/20 @1:28PM: Janet proposed adding a new column. <br />
            </section>
        </div>
    </section>
  )
}

export default App;
